# criação da tabela categoria

CREATE TABLE categoria (
  pk_categoria INTEGER  AUTO_INCREMENT,
  nome_cat VARCHAR(50)  NOT NULL  ,
  detalhes_cat VARCHAR(255) ,
PRIMARY KEY(pk_categoria)
);

