CREATE TABLE colaborador(
  pk_colaborador integer auto_increment,
  fk_cidade integer not null,
  nome_col varchar(200),
  cpf_col numeric(11),
  nasc_col date,
  fone_col varchar(14),
  email_col varchar(100),
  PRIMARY KEY (pk_colaborador),
  FOREIGN KEY (fk_cidade)
  REFERENCES cidade (pk_cidade)
     ON DELETE RESTRICT 
     ON UPDATE CASCADE
);

