CREATE TABLE cliente (
  pk_cliente integer auto_increment,
  fk_cidade integer not null,
  nome_cli varchar(200),
  cadastro_cli date,
  fone_cli varchar(14),
  email_cli varchar(200),
  PRIMARY KEY (pk_cliente),
  FOREIGN KEY (fk_cidade)
     REFERENCES cidade (pk_cidade)
         ON DELETE RESTRICT
         ON UPDATE CASCADE
