CREATE TABLE produto (
  pk_produto integer auto_increment,
  fk_marca integer not null,
  fk_categoria integer not null,
  nome_pro varchar(200),
  preco_pro numeric(6,2),
  icms_pro numeric(3),
  estoque_pro integer,
  PRIMARY KEY (pk_produto),
  FOREIGN KEY (fk_marca)
    REFERENCES marca (pk_marca)
       ON DELETE RESTRICT
	ON UPDATE CASCADE,
  FOREIGN KEY (fk_categoria)
    REFERENCES categoria (pk_categoria)
       ON DELETE RESTRICT
	ON UPDATE CASCADE
);







