# criação da tabela ordem_servico

CREATE TABLE ordem_servico (
  pk_os integer auto_increment,
  fk_colaborador integer not null,
  fk_cliente integer not null,
  abertura_os date,
  obs_os varchar(255),
  PRIMARY KEY (pk_os),
  FOREIGN KEY (fk_colaborador)
    REFERENCES colaborador (pk_colaborador)
    ON DELETE RESTRICT
    ON UPDATE CASCADE,
   FOREIGN KEY (fk_cliente)
      REFERENCES cliente (pk_cliente)
         ON DELETE RESTRICT 
         ON UPDATE CASCADE
);











