CREATE TABLE item (
  pk_item integer auto_increment,
  fk_os integer not null,
  fk_produto integer not null,
  quantidade integer,
  preco numeric(6,2),
  desconto numeric(3),
  PRIMARY KEY (pk_item),
  FOREIGN KEY (fk_os)
   REFERENCES ordem_servico (pk_os)
    ON DELETE RESTRICT 
    ON UPDATE CASCADE,
  FOREIGN KEY (fk_produto)
   REFERENCES produto (pk_produto)
    ON DELETE RESTRICT 
    ON UPDATE CASCADE
);
















