CREATE TABLE forn_prod (
  pk_forn_prod integer auto_increment,
  fk_fornecedor integer not null,
  fk_produto integer not null,
  prazo integer,
  preco numeric(10,2),
  PRIMARY KEY (pk_forn_prod),
  FOREIGN KEY (fk_fornecedor)
    REFERENCES fornecedor (pk_fornecedor)
    ON DELETE RESTRICT
    ON UPDATE CASCADE,
  FOREIGN KEY (fk_produto)
     REFERENCES produto (pk_produto)
    ON DELETE RESTRICT
    ON UPDATE CASCADE
);








